// src/components/SignUp.js
import React from 'react';

const SignUp = ({ onSignUp }) => {
  const handleSignUp = () => {
    // Simulate successful sign-up
    onSignUp('user@example.com', 'sample-token');
  };

  return (
    <div>
      <h1>Sign Up</h1>
      <button onClick={handleSignUp}>Sign Up</button>
    </div>
  );
};

export default SignUp;
